"use strict";(self.webpackChunkceluveat_team_blog=self.webpackChunkceluveat_team_blog||[]).push([[115],{7329:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"/woowa-final","metadata":{"permalink":"/team-blog/front-blog/woowa-final","source":"@site/@frontBlog/woowa-final.mdx","title":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30\uc5d0 \ud569\ub958\ud558\uba70","description":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30 \uc6f9 \ud504\ub860\ud2b8\uc5d4\ub4dc \ud2b8\ub799\uc5d0 \ud569\ub958\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc9c0\uae08\uae4c\uc9c0 \uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4\uc5d0 \ucc38\uc5ec\ud558\uba74\uc11c \ub290\ub080\uc810\uacfc \uc18c\uac10\uc744 \uc815\ub9ac\ud574 \ubcf4\uba70 \ud55c\ud3b8\uc758 \uae00\ub85c \ub0a8\uaca8\ubcf4\ub824\uace0 \ud569\ub2c8\ub2e4.","date":"2023-03-04T00:00:00.000Z","formattedDate":"2023\ub144 3\uc6d4 4\uc77c","tags":[{"label":"\ud68c\uace0","permalink":"/team-blog/front-blog/tags/\ud68c\uace0"},{"label":"\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4","permalink":"/team-blog/front-blog/tags/\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4"},{"label":"\uae00\uc4f0\uae30","permalink":"/team-blog/front-blog/tags/\uae00\uc4f0\uae30"}],"readingTime":10.295,"hasTruncateMarker":true,"authors":[{"name":"minjae Kim","url":"https://github.com/d0dam","email":"smallkdb@gmail.com","imageURL":"https://avatars.githubusercontent.com/u/51052049?v=4","key":"d0dam"}],"frontMatter":{"date":"2023-03-04T00:00:00.000Z","authors":"d0dam","title":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30\uc5d0 \ud569\ub958\ud558\uba70","description":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30 \uc6f9 \ud504\ub860\ud2b8\uc5d4\ub4dc \ud2b8\ub799\uc5d0 \ud569\ub958\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc9c0\uae08\uae4c\uc9c0 \uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4\uc5d0 \ucc38\uc5ec\ud558\uba74\uc11c \ub290\ub080\uc810\uacfc \uc18c\uac10\uc744 \uc815\ub9ac\ud574 \ubcf4\uba70 \ud55c\ud3b8\uc758 \uae00\ub85c \ub0a8\uaca8\ubcf4\ub824\uace0 \ud569\ub2c8\ub2e4.","keywords":["\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4","\ud68c\uace0","\uae00\uc4f0\uae30"],"tags":["\ud68c\uace0","\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4","\uae00\uc4f0\uae30"]},"nextItem":{"title":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30 \ud504\ub9ac\ucf54\uc2a4 \ud68c\uace0(1)","permalink":"/team-blog/front-blog/woowa-precourse-week1-week2"}},"content":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30 \uc6f9 \ud504\ub860\ud2b8\uc5d4\ub4dc \ud2b8\ub799\uc5d0 \ud569\ub958\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uc9c0\uae08\uae4c\uc9c0 \uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4\uc5d0 \ucc38\uc5ec\ud558\uba74\uc11c \ub290\ub080\uc810\uacfc \uc18c\uac10\uc744 \uc815\ub9ac\ud574 \ubcf4\uba70 \ud55c\ud3b8\uc758 \uae00\ub85c \ub0a8\uaca8\ubcf4\ub824\uace0 \ud569\ub2c8\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n## \ud569\uaca9\\n\\n<img src=\'/img/blog/woowa-final/result.png\' alt=\'\uc774\ubbf8\uc9c0\' style={{ marginBottom: \'20px\' }} />\\n\\n\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4 5\uae30 \ud504\ub860\ud2b8\uc5d4\ub4dc \ud2b8\ub799\uc5d0 \ud569\ub958\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.<br />\\n1\ucc28 \ud569\uaca9 \uc18c\uc2dd\uc744 \uc811\ud560 \ub54c\ub3c4 \uc0c1\ub2f9\ud788 \uc5bc\ub5a8\ub5a8 \ud588\ub294\ub370 \uc774\uc81c\ub294 \ucd5c\uc885 \ucf54\ub529 \ud14c\uc2a4\ud2b8\ub97c \uac70\uce58\uace0 \ud569\uaca9 \uc774\uba54\uc77c\uc744 \ub9c8\uc8fc\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n\uc544\uc9c1\ub3c4 \ucd5c\uc885 \ucf54\ub529 \ud14c\uc2a4\ud2b8 \ub54c\uc758 \uc77c\uc774 \uae30\uc5b5\ub0a9\ub2c8\ub2e4.<br />\\n\uc2dc\uac04\uc774 10\ubd84 \ubc16\uc5d0 \ub0a8\uc9c0 \uc54a\uc558\uc744 \ub54c \ucf54\ub4dc \uc5d0\ub7ec\uac00 \ud574\uacb0\ub418\uc9c0 \uc54a\uc544\uc11c \ud3ec\uae30\ud560\uae4c \ud558\ub2e4\uac00\ub3c4 \ub05d\uae4c\uc9c0 \ubd99\uc7a1\uace0 \ub298\uc5b4\uc84c\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uc5b4\ub5bb\uac8c \uc5bb\uc5b4\ub0b8 \uae30\ud68c\uc778\ub370, \uc774 \uae30\ud68c\uc5d0 \uc81c \ucd5c\uc120\uc744 \ub2e4 \ub2f4\uc544\ubcf4\uace0 \uc2f6\uc5c8\uc2b5\ub2c8\ub2e4. \uc774\ub798\uc57c \ub5a8\uc5b4\uc838\ub3c4 \ud6c4\ud68c\uac00 \ub0a8\uc9c0 \uc54a\uc744 \uac83 \uac19\uc558\ub2ec\uae4c\uc694?\\n\uc9c4\uc2ec\uc774 \ub2ff\uc558\ub358 \uac78\uae4c, 4\ubd84\uc744 \ub0a8\uae30\uace0 \ucf54\ub4dc\uc758 \ubb38\uc81c\uc810\uc744 \ucc3e\uc544\ub0b4\uc11c 10~15\uc904 \uac00\ub7c9 \ub418\ub294 \ucf54\ub4dc\ub97c \uc815\ub9d0 \uc2e0\ub4e4\ub9b0 \ub4ef\uc774 \uc368\ub0b4\ub824\uac14\uc2b5\ub2c8\ub2e4.(\uc9c0\uae08 \uc774\ub807\uac8c \ud558\ub77c\uace0 \ud558\uba74 \uc808\ub300 \ubabb\ud560 \uac83 \uac19\uc544\uc694..:innocent:)\\n\uadf8\ub9ac\uace0 \ub290\ub080\uc810\uc744 \uc791\uc131\ud574 \uc81c\ucd9c\uc744 \ud558\uace0 \uc2dc\uac04\uc744 \ubcf4\ub2c8 1\ubd84 \ucc44 \ub0a8\uc9c0 \uc54a\uc558\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\ud14c\uc2a4\ud2b8\ub3c4 \uc791\uc131\uc744 \ubabb\ud558\uace0 \ucf54\ub4dc\ub3c4 \ub4a4\uc8fd\ubc15\uc8fd \uc11e\uc5ec \uc788\ub294 \uc815\ub9d0 \uad74\ub7ec\ub9cc \uac00\ub294 \uc2a4\ud30c\uac8c\ud2f0 \ucf54\ub4dc\uc600\uc2b5\ub2c8\ub2e4.\\n\ud604\uc7ac \uc2e4\ub825\uc774 \uc774\ub807\uad6c\ub098 \uae68\ub2eb\uae30\ub3c4 \ud588\uc9c0\ub9cc, \uc815\ub9d0 \ucd5c\uc120\uc744 \ub2e4\ud588\uae30\uc5d0 \ud6c4\ud68c\ub294 \uc5c6\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uadf8\ub798\uc11c\uc77c\uae4c \uc774\ubc88 \ud569\uaca9\uc740 \uc2a4\uc2a4\ub85c\uc758 \ucd5c\uc120\uacfc \uc9c0\uae08\uae4c\uc9c0 \uc313\uc544\uc628 \ub178\ub825\uc744 \uc218\uace0\ud588\ub2e4\uace0 \uc778\uc815\ud574 \uc8fc\ub294 \uac83 \uac19\uc558\uc2b5\ub2c8\ub2e4.\\n\\n## \ud569\ub958\\n\\n\uc6b0\ud14c\ucf54\ub294 \uc55e\uc73c\ub85c \uc778\uc0dd\uc5d0 \uc788\uc744 \uc218 \uc788\ub294 \uc218\ub9ce\uc740 \uae38 \uc911\uc5d0 \ud558\ub098\ub77c\uace0 \uc0dd\uac01\ud588\uc2b5\ub2c8\ub2e4.\\n\uc774 \uae38\uc744 \ud0dd\ud558\uae30 \uc704\ud574 \ucc38 \ub9ce\uc740 \uace0\ubbfc\uc744 \ud588\uc2b5\ub2c8\ub2e4.\\n\ud0dd\ud558\uace0 \ub098\uc11c\ub3c4 \uc815\ub9d0 \ucd5c\uc120\uc744 \ub2e4\ud588\uc2b5\ub2c8\ub2e4.\\n\uadf8\ub807\uac8c \uc57d \ud55c\ub2ec\uc774\ub77c\ub294 \uc2dc\uc791\uc774 \ud758\ub800\uc2b5\ub2c8\ub2e4.<br />\\n\uc774 \ub3d9\uc548 \uc2a4\uc2a4\ub85c\uc640 \uac19\uc774 \ud558\ub294 \uc0ac\ub78c\ub4e4\uc5d0\uac8c \uc815\ub9d0 \ub9ce\uc740 \uac10\uc815\uc744 \ub290\uaf08\uc2b5\ub2c8\ub2e4.\\n\uc774 \uac10\uc815\uc744 \uc138\uac1c\uc758 \uba54\uc138\uc9c0\uc5d0 \ub2f4\uc544 \ud45c\ud604\ud574\ubcf4\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4.\\n\\n---\\n\\n#### \ub098\uc640 \ud06c\ub8e8\uc5d0\uac8c\\n\\n### \uad1c\ucc2e\uc544, \uae38\uc744 \uac77\ub294 \uacfc\uc815\uc774\uc796\uc544.\\n\\n\ubd88\uc548\ud558\ub2e4.<br />\\n\uac77\uace0 \uc788\ub294 \uae38\uc774 \uc62c\ubc14\ub978 \uae38\uc778\uc9c0 \uc790\uafb8 \ub4a4\ub3cc\uc544\ubcf4\uac8c \ub41c\ub2e4.\\n\uadf8\ub798\uc11c \uae38\uc744 \uac77\ub2e4\uac00\ub3c4 \uba48\ucdb0\uc11c\uac8c \ub418\uace0 \ubc1c\uac78\uc74c\ub3c4 \uac00\ubccd\uc9c0 \uc54a\ub2e4.\\n\uadf8\ub807\uac8c \uae38 \uac00\uc6b4\ub370\uc11c \uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4\ub77c\ub294 \uc774\uc815\ud45c\ub97c \ubc1c\uacac\ud588\ub2e4.\\n\uc6d0\ub798 \uad00\uc2ec\uc740 \ud06c\uac8c \uc5c6\uc5c8\ub2e4. \uc774 \uae38\uc744 \ub0b4\uac00 \uac08 \uc218 \uc788\ub294 \uae38\uc774\ub77c\uace0 \uc0dd\uac01 \uc870\ucc28 \ud558\uc9c0 \uc54a\uc558\ub2e4.\\n\ud558\uc9c0\ub9cc \uc774\uc815\ud45c\ub97c \ubc14\ub77c\ubcf4\ub2c8 \uc774 \uae38\uc774 \uc5b4\ub5a4\uc9c0 \ud55c \ubc88 \ub290\uaef4 \ubcf4\ub77c\uace0, \uc77c\ub2e8 \uac78\uc5b4\ubcf4\ub77c\uace0 \ud55c\ub2e4.\\n\uc5b4\ub514\uc5d0\uc11c \ub098\uc628 \uc790\uc2e0\uac10\uc77c\uae4c? \uc774 \uae38\uc744 \uac78\uc5b4\ubcf8\ub2e4\uba74 \ucd5c\uc18c\ud55c \ubd88\uc548\uc740 \uc5c6\uc568 \uc218 \uc788\uc744 \uac83\ub9cc \uac19\uc558\ub2e4.\\n\\n> \'\uad1c\ucc2e\uc544, \uae38\uc744 \uac77\ub294 \uacfc\uc815\uc774\uc796\uc544.\'\\n\\n\uc2a4\uc2a4\ub85c \ub2e4\ub3c5\uc600\ub2e4. \uc544\uc9c1 \uacfc\uc815\uc5d0 \ubd88\uacfc\ud558\ub2e4.\\n\uc55e\uc73c\ub85c \ub0a8\uc740 \uae38\uc744 \ud3b8\ud55c \ub9c8\uc74c\uc73c\ub85c \ub098\uc544\uac00\uae30 \uc704\ud574\uc11c\ub294 \ubd88\uc548\uc744 \ud655\uc2e0\uc73c\ub85c \ubc14\uafc0 \ud544\uc694\uac00 \uc788\uc5c8\ub2e4.\\n\uc774\ub807\uac8c \uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4\ub77c\ub294 \uc774\uc815\ud45c\ub97c \ub530\ub77c \uccab \ubc1c\uc790\uad6d\uc744 \ub0b4\ub51b\uc5c8\ub2e4.\\n\\n### \uc798\ud588\uc5b4, \uc774\uc81c\ub294 \ub098\uc544\uac00\ubcf4\uc790.\\n\\n\ud655\uc2e0\ud55c\ub2e4.<br />\\n\uc6d0\ud558\ub358 \uae38\uc774\ub2e4. \uae38 \uc790\uccb4\ub294 \ub108\ubb34\ub098 \ud5d8\ub09c\ud558\uace0 \ud798\ub4e4\ub2e4. \uc2ec\uc9c0\uc5b4 \uc55e\uc73c\ub85c \ub354\uc6b1\ub354 \ud5d8\ub09c\ud574\uc9c8\uac70\ub77c\uace0 \uacbd\uace0\ub3c4 \ud55c\ub2e4.\\n\uadf8\ub7f0\ub370 \ubd88\uc548\ud558\uc9c0 \uc54a\ub2e4. \uae38\uc744 \ub2e4 \ubabb\uac78\uc744\uae4c \uac71\uc815\uc774 \ub420\ub9cc\ub3c4 \ud55c\ub370 \uadf8\ub0e5 \uc774 \uae38\uc744 \uac77\ub294 \uac83 \uc790\uccb4\ub9cc\uc73c\ub85c \uacbd\ucf8c\ud558\ub2e4.\\n\\n\ud559\uad50\ub294 \ub9e4\uc77c\uc774 \uac19\uc558\ub2e4. \uc77c\uc5b4\ub098\uc11c \uc218\uc5c5\uc744 \ub4e3\uace0 \uadf8 \ub0a0 \uc218\uc5c5\uc774 \ubaa8\ub450 \ub05d\ub098\uba74 \uae30\uc219\uc0ac\ub85c \ub3cc\uc544\uac00 \uc26c\uc5c8\ub2e4.\\n\ub531\ud788 \ud798\ub4e4\uc9c0\ub294 \uc54a\uc558\uc9c0\ub9cc, \ub611\uac19\uc740 \uad74\ub808\uc5d0 \uac07\ud78c \ub290\ub08c\uc774\uc5c8\ub2e4.\\n\uc6b0\ud14c\ucf54\ub294 \ub9e4\uc77c\uc774 \ub2e4\ub974\ub2e4. \uc81c\uc77c \ud070 \ucc28\uc774\ub294 \uc0ac\ub78c\ub4e4\uacfc\uc758 \uc18c\ud1b5\uc774\ub2e4. \ub611\uac19\uc774 \uc77c\uc5b4\ub098\uc11c \ucd9c\uadfc\uc744 \ud558\uace0 \uc120\ub989 \ucea0\ud37c\uc2a4\ub85c \ud5a5\ud55c\ub2e4.\\n\ucea0\ud37c\uc2a4\uc5d0 \ub4e4\uc5b4\uc624\ub294 \uc21c\uac04 \ub9c8\uc8fc\uce58\ub294 \ud06c\ub8e8\uc640 \uc778\uc0ac\ub97c \ub098\ub208\ub2e4.\\n\uadf8\ub9ac\uace0 \ub370\uc77c\ub9ac \ubbf8\ud305\uc73c\ub85c \ud558\ub8e8\ub97c \uc2dc\uc791\ud55c\ub2e4. \uc5ec\ub7ec \uc0ac\ub78c\ub4e4\uacfc \uac16\uac00\uc9c0 \ud65c\ub3d9\uc774\ub098 \uc774\uc57c\uae30\ub85c \uc11c\ub85c\uc758 \uac10\uc815\uc744 \uacf5\uc720\ud55c\ub2e4.\\n\ub300\ubd80\ubd84\uc758 \ubbf8\uc158\uacfc \ud68c\uace0\ub294 \ubaa8\ub450 \uc18c\ud1b5\uc744 \uc804\uc81c\ub85c \ud55c\ub2e4. \uc5f0\uadf9\ub3c4 \ud558\uace0 \uae00\uc4f0\uae30\ub3c4 \ud55c\ub2e4. \ud56d\uc0c1 \ub2e4\ub978 \ud398\uc5b4\uc640 \ud558\ub098\uc758 \ucf54\ub4dc\ub97c \uc368 \ub0b4\ub824\uac04\ub2e4.\\n\uc774 \ubaa8\ub4e0 \uacfc\uc815\uc774 \uc990\uac81\ub2e4.\\n\\n\uacfc\uac70\uc5d0\ub294 \ubb34\uc5c7\uc744 \uacf5\ubd80\ud560 \uc9c0 \uace0\ubbfc\ud558\uba70 \uace0\ud1b5\uc2a4\ub7ec\uc6cc\ud588\ub2e4.\\n\uc774\uc81c\ub294 \uc5ec\ub7ec \ubbf8\uc158\ub4e4\uc744 \ud574\uacb0\ud574 \ub098\uac00\uba74\uc11c \uacf5\ubd80\ud558\uace0 \uc2f6\uc740 \uac83\uc774 \uacc4\uc18d \uc0dd\uaca8\ub09c\ub2e4.\\n\ubb3c\ub860 \uc774 \uc591\uc774 \ub108\ubb34 \ub9ce\uc544\uc11c \uae30\uc220 \ubd80\ucc44\ub85c \uc313\uc5ec\uac00\uc9c0\ub9cc \ubd88\uc548\ud558\uc9c0 \uc54a\ub2e4.\\n\uc624\ud788\ub824 \uacf5\ubd80 \ud560 \uc218 \uc788\ub294 \uac83\uc774 \ub9ce\uc544\uc838\uc11c \ub4e4\ub72c\ub2e4.\\n\uc774 \uae38\uc744 \uc120\ud0dd\ud55c \uc790\uc2e0\uc5d0\uac8c \uce6d\ucc2c \ud574\uc8fc\uace0 \uc2f6\ub2e4.\\n\\n> \'\uc798\ud588\uc5b4, \uc774\uc81c\ub294 \ub098\uc544\uac00\ubcf4\uc790.\'\\n\\n\ud655\uc2e0\uc774 \uc0dd\uaca8\uc11c\uc77c\uae4c? \uc81c\ub300\ub85c \ucd94\uc9c4\ub825\uc744 \uc5bb\uc744 \uc218 \uc788\uc5c8\ub2e4. \uc2a4\uc2a4\ub85c \uc774 \uae38\uc744 \uc5f4\uc2ec\ud788 \ub098\uc544\uac00\ubcf4\uc790\uace0 \uc751\uc6d0\ud558\uace0 \uc788\ub2e4.\\n\uadf8\ub807\uac8c \ud604\uc7ac\ub294 \uba48\ucdb0\uc11c\uac70\ub098 \ub4a4\ub97c \uc2e0\uacbd\uc4f0\uc9c0 \uc54a\uace0 \uc55e\uc744 \ubcf4\uba70 \ub098\uc544\uac00\uace0 \uc788\ub2e4.\\n\\n### \uace0\ub9c8\uc6cc, \uac19\uc740 \uae38\uc744 \uac78\uc5b4\uc918\uc11c.\\n\\n\ud589\ubcf5\ud558\ub2e4.<br />\\n\ub09c \uc0ac\ub78c\uc744 \ucc38 \uc88b\uc544\ud55c\ub2e4. \uadf8\ub798\uc11c \uae38\uc744 \ub098\uc544\uac00\uba70 \ub2e4\uc591\ud558\uace0 \uc0c8\ub85c\uc6b4 \uc0ac\ub78c\uc744 \ub9cc\ub0a0 \uc218 \uc788\uc5b4\uc11c \ud589\ubcf5\ud558\ub2e4.\\n\\n> \uc548\ub155\ud558\uc138\uc694~! \ub2c9\ub124\uc784\uc774 \uc5b4\ub5bb\uac8c \ub418\uc138\uc694?\\n\\n\uae38\uc744 \uac77\ub2e4 \uc0c8\ub85c\uc6b4 \uc0ac\ub78c\uc744 \ubcf4\uba74 \ub9d0\uc744 \uac78\uac8c \ub41c\ub2e4. \uadf8 \uc0ac\ub78c\uc5d0 \ub300\ud574 \uc54c\uace0\uc2f6\uace0 \uce5c\ud574\uc9c0\uace0 \uc2f6\uc5c8\ub2e4.\\n\uadf8\ub798\uc11c \uc2dd\uc0ac \uc790\ub9ac\ub97c \ub9cc\ub4e4\uae30\ub3c4 \ud558\uace0 \uc18c\uc18c\ud55c \ub300\ud654 \uc790\ub9ac\ub97c \ub9cc\ub4e4\uc5b4\ubcf4\uae30\ub3c4 \ud588\ub2e4.\\n\uac01\uc790 \ubaa8\ub450 \uac1c\uc131\uc774 \ub118\uce58\uace0 \ucc29\ud574\uc11c \uc6c3\uc74c\uc774 \uc808\ub85c \ub098\uc628\ub2e4. \ud55c \uba85\ub3c4 \ube60\uc9d0\uc5c6\uc774 \ubaa8\ub450\uc640 \uce5c\ud574\uc9c0\uace0 \uc2f6\uc5c8\uace0, \uc815\ub9d0 \uc5f4\uc2ec\ud788 \uc0ac\ub78c\ub4e4\uacfc \uc5b4\uc6b8\ub9ac\ub824\uace0 \ub178\ub825\ud588\ub2e4. <br />\\n\uadf8\ub807\uac8c \uac19\uc774 \uc5b4\uc6b8\ub9ac\uba70 \uac78\uc5b4\uc628 \uc6b0\ud14c\ucf54 \ud06c\ub8e8\ub4e4\uc5d0\uac8c \ub9ce\uc740 \uac83\uc744 \ub290\uaf08\ub2e4. \uc6b0\ud14c\ucf54 \ud06c\ub8e8\ub4e4\uc740 \ucf54\ub529\uc744 \uc5c4\uccad \uc798\ud558\ub294 \uc0ac\ub78c\uc774\ub77c\uace0\ub294 \uc0dd\uac01\ud558\uc9c0 \uc54a\ub294\ub2e4.\\n\ub2e4\ub9cc, \ub2e4\ub4e4 \uc790\uc2e0\uc758 \uc758\uacac\uc744 \ud53c\ub825\ud558\uace0 \ucf54\ub4dc\uc5d0 \uc790\uc2e0\uc758 \uac00\uce58\uad00\uc744 \ub2f4\uc744 \uc904 \uc544\ub294 \uc0ac\ub78c\ub4e4\uc774\ub2e4. \ucf54\ub4dc\ub97c \ubcf4\uba74 \uc774\uac8c \uc5b4\ub5a4 \ud06c\ub8e8\uc758 \ucf54\ub4dc\uc778\uc9c0 \uc870\uae08\uc529 \ubcf4\uc774\uae30 \uc2dc\uc791\ud55c\ub2e4.\\n\uadf8\ub9ac\uace0 \ub2e4\ub4e4 \uc774 \uae38\uc744 \uc790\uc2e0\ub9cc\uc758 \uac1c\uc131\ub300\ub85c \uc990\uac81\uac8c \uac78\uc5b4\uac00\uace0 \uc788\ub2e4. \uc774 \ud48d\uacbd\uc774 \ub108\ubb34 \uba4b\uc788\ub294 \uac83 \uac19\ub2e4. \ub611\uac19\uc740 \uae38\uc744 \uac00\uace0 \uc788\uc9c0\ub9cc \ubaa8\ub450\uac00 \uadf8 \ubc29\ubc95\uc740 \uc870\uae08\uc529 \ub2e4\ub978 \uac83 \uac19\ub2e4.\\n\\n> \'\uace0\ub9c8\uc6cc, \uac19\uc740 \uae38\uc744 \uac78\uc5b4\uc918\uc11c\'\\n\\n\ud568\uaed8 \ub9d0\uc744 \uc11e\uc5b4\ubcf8 \ud06c\ub8e8\ub098 \ucf54\uce58\ubd84\uc774\ub77c\uba74 \uace0\ub9d9\ub2e4\ub294 \ub9d0\uc744 \uc804\ud558\uace0 \uc2f6\ub2e4.\\n\uc774 \ubaa8\ub450\ub294 \uae38\uace0 \ud5d8\ub09c\ud55c \uae38\uc5d0\uc11c \ud798\uacfc \uc790\uadf9\uc744 \uc8fc\uace0 \ud589\ubcf5\uc744 \uc804\ud574\uc900\ub2e4.\\n\uc774 \uc0ac\ub78c\ub4e4\uc774\ub77c\uba74 \ud55c \ub2ec\uc774 \uc544\ub2c8\ub77c \ud55c \ud3c9\uc0dd\uc744 \uac78\uc5b4\ub098\uac00\ub354\ub77c\ub3c4 \uad1c\ucc2e\uc9c0 \uc54a\uc744\uae4c?\\n\\n## \ub9fa\uc74c\ub9d0\\n\\n\uc544\ub9c8 \uc81c\ubaa9\uc744 \ubcf4\uace0 \uc6b0\ud14c\ucf54 5\uae30\uc5d0 \ud569\ub958\ud558\uba74\uc11c \uc5b4\ub5a4 \uc77c\ub4e4\uc774 \uc788\uc5c8\ub294\uc9c0\ub97c \uc0dd\uac01\ud558\uace0 \ub4e4\uc5b4\uc654\uc744 \uc218\ub3c4 \uc788\uc2b5\ub2c8\ub2e4.\\n\ubb3c\ub860 \uc5ec\ub7ec\uac00\uc9c0 \uc0ac\uac74\ub4e4\ub3c4 \uac12\uc9c4 \ucd94\uc5b5\ub4e4\uc785\ub2c8\ub2e4. \ud558\uc9c0\ub9cc \ud55c\ub2ec\uac04 \ub290\ub080 \uc774 \uac10\uc815\ub4e4\uc740 \ub354\uc6b1 \ub354 \uac12\uc9c0\ub2e4\uace0 \ub290\uaf08\uace0 \uc774 \ub290\ub080\uc810\uc744 \uc704\uc8fc\ub85c \uae00\uc744 \uc368\ub0b4\ub824\uac00\uace0 \uc2f6\uc5c8\uc5b4\uc694.\\n\uc800\ub294 \uc55e\uc73c\ub85c 9\uac1c\uc6d4 \ub3d9\uc548 \ub354 \uc774 \uae38\uc744 \uac78\uc5b4\ub098\uac00\uac8c \ub429\ub2c8\ub2e4! \uc774 \ub3d9\uc548 \uc9c0\uae08\uacfc \uac19\uc740 \uac10\uc815\uc774 \uacc4\uc18d\ub418\uae30\ub97c \uae30\ub300\ud558\uace0 \uc788\uc5b4\uc694! \uc5ec\ub7ec\ubd84\ub3c4 \uc751\uc6d0\ud574\uc8fc\uc138\uc694~!"},{"id":"/woowa-precourse-week1-week2","metadata":{"permalink":"/team-blog/front-blog/woowa-precourse-week1-week2","source":"@site/@frontBlog/woowa-precourse-week1-week2.mdx","title":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30 \ud504\ub9ac\ucf54\uc2a4 \ud68c\uace0(1)","description":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30 \uc6f9 \ud504\ub860\ud2b8\uc5d4\ub4dc \ud2b8\ub799\uc5d0 \uc9c0\uc6d0\ud55c\uc9c0 \ubc8c\uc368 2\uc8fc\uac00 \ub118\uac8c \ud758\ub800\uc2b5\ub2c8\ub2e4. \uc9c0\uae08\uae4c\uc9c0 \ud504\ub9ac\ucf54\uc2a4\ub97c \ucc38\uc5ec\ud558\uba74\uc11c \ub290\ub080\uc810\uacfc \uc18c\uac10\uc744 \uc815\ub9ac\ud574 \ubcf4\uba74\uc11c \ub418\ub3cc\uc544\ubcf4\ub294 \uc2dc\uac04\uc744 \uac00\uc9c0\ub824 \ud569\ub2c8\ub2e4.","date":"2022-11-10T00:00:00.000Z","formattedDate":"2022\ub144 11\uc6d4 10\uc77c","tags":[{"label":"\ud68c\uace0","permalink":"/team-blog/front-blog/tags/\ud68c\uace0"},{"label":"\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4","permalink":"/team-blog/front-blog/tags/\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4"},{"label":"JS","permalink":"/team-blog/front-blog/tags/js"}],"readingTime":17.875,"hasTruncateMarker":true,"authors":[{"name":"minjae Kim","url":"https://github.com/d0dam","email":"smallkdb@gmail.com","imageURL":"https://avatars.githubusercontent.com/u/51052049?v=4","key":"d0dam"}],"frontMatter":{"date":"2022-11-10T00:00:00.000Z","authors":"d0dam","title":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30 \ud504\ub9ac\ucf54\uc2a4 \ud68c\uace0(1)","description":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30 \uc6f9 \ud504\ub860\ud2b8\uc5d4\ub4dc \ud2b8\ub799\uc5d0 \uc9c0\uc6d0\ud55c\uc9c0 \ubc8c\uc368 2\uc8fc\uac00 \ub118\uac8c \ud758\ub800\uc2b5\ub2c8\ub2e4. \uc9c0\uae08\uae4c\uc9c0 \ud504\ub9ac\ucf54\uc2a4\ub97c \ucc38\uc5ec\ud558\uba74\uc11c \ub290\ub080\uc810\uacfc \uc18c\uac10\uc744 \uc815\ub9ac\ud574 \ubcf4\uba74\uc11c \ub418\ub3cc\uc544\ubcf4\ub294 \uc2dc\uac04\uc744 \uac00\uc9c0\ub824 \ud569\ub2c8\ub2e4.","keywords":["\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4","\ud504\ub9ac\ucf54\uc2a4","\ud68c\uace0","\ucf54\ub4dc\ub9ac\ubdf0","js"],"tags":["\ud68c\uace0","\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4","JS"]},"prevItem":{"title":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30\uc5d0 \ud569\ub958\ud558\uba70","permalink":"/team-blog/front-blog/woowa-final"}},"content":"\uc6b0\uc544\ud55c \ud14c\ud06c\ucf54\uc2a4 5\uae30 \uc6f9 \ud504\ub860\ud2b8\uc5d4\ub4dc \ud2b8\ub799\uc5d0 \uc9c0\uc6d0\ud55c\uc9c0 \ubc8c\uc368 2\uc8fc\uac00 \ub118\uac8c \ud758\ub800\uc2b5\ub2c8\ub2e4.\\n\uc9c0\uae08\uae4c\uc9c0 \ud504\ub9ac\ucf54\uc2a4\ub97c \ucc38\uc5ec\ud558\uba74\uc11c \ub290\ub080\uc810\uacfc \uc18c\uac10\uc744 \uc815\ub9ac\ud574 \ubcf4\uba74\uc11c \ub418\ub3cc\uc544\ubcf4\ub294 \uc2dc\uac04\uc744 \uac00\uc9c0\ub824 \ud569\ub2c8\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n### \uc2dc\uc791\uc5d0 \uc55e\uc11c...\\n\\n\uc774\ubc88 \ud504\ub9ac\ucf54\uc2a4\ub85c\ubd80\ud130 \uc5bb\uc740 \uc9c0\uc2dd\uc774 \uad49\uc7a5\ud788 \ub9ce\uc9c0\ub9cc, \uc5bb\uc740 \uc9c0\uc2dd \ub9cc\ud07c\uc774\ub098 \ucc38\uc5ec\ud558\uba74\uc11c \ub290\ub080 \uac10\uc815\ub4e4\uc774 \uc815\ub9d0 \ub2e4\uc591\ud569\ub2c8\ub2e4.\\n\uac1c\ubc1c\uc790\ub97c \uafc8\uafbc \uc81c\uac00 \ub108\ubb34 \uc790\ub791\uc2a4\ub7ec\uc6b8 \uc815\ub3c4\ub85c \uac1c\ubc1c\uc774 \ub108\ubb34 \uc88b\uc544\uc84c\uc2b5\ub2c8\ub2e4.\\n\uadf8\ub798\uc11c \uc9c0\uc2dd \uc704\uc8fc \ubcf4\ub2e4\ub294 **\uadf8 \uacfc\uc815 \uc18d\uc5d0\uc11c \uc5bb\uace0, \ub290\ub080 \uac10\uc815\uacfc \uc18c\uac10\uc744 \uc704\uc8fc\ub85c \uc791\uc131**\ud588\uc2b5\ub2c8\ub2e4.\\n\\n## \uc2dc\uc791\\n\\n\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4\uac00 \uc774\ubc88 \uae30\uc218\ubd80\ud130 \ud504\ub9ac\ucf54\uc2a4\uc5d0 \ucd94\uac00\ud55c \ucee4\ubba4\ub2c8\ud2f0\ub294 \uc815\ub9d0 \uc81c \ub9c8\uc74c\uc5d0 \uc3d9 \ub4e4\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uac1c\ubc1c\uc790\ub97c \uafc8\uafb8\ub294 \uc5ec\ub7ec \uc0ac\ub78c\ub4e4\uc774 \ud55c\ub370 \ubaa8\uc774\ub2c8 \uadf8 \uc5f4\uc815\uc774 \ubc14\uae65\uc73c\ub85c \ubfdc\uc5b4\uc838 \ub098\uc624\ub294 \uac83 \uac19\uc740 \ub290\ub08c\uc774 \uc88b\uc558\uc2b5\ub2c8\ub2e4.\\n\uc774 \uc548\uc5d0\uc11c \uc5ec\ub7ec \uc0ac\ub78c\ub4e4\uacfc \uc18c\ud1b5\ud558\uba70 \uc758\uacac\uc744 \ub098\ub204\ub294 \uacbd\ud5d8\uc740 \uc800\ub97c \ud504\ub9ac\ucf54\uc2a4\uc5d0 \ub354 \ud479 \ube60\uc9c0\uac8c \ub9cc\ub4e4\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n## \uafb8\uc900\ud55c \uace0\ubbfc\uc740 \uace0\ubbfc\ud558\ub294 \uc2b5\uad00\uc744 \ub9cc\ub4e0\ub2e4.\\n\\n\ucd5c\ub300\ud55c \uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4 \ucee4\ubba4\ub2c8\ud2f0\uc758 \ub3c4\uc6c0 \uc5c6\uc774 **\ud63c\uc790 \uace0\ubbfc\ud574\ubcf4\uace0 \uacb0\ub860\uc744 \ub3c4\ucd9c\ud574 \ub0b4\ub824\uace0 \ub178\ub825**\ud588\uc2b5\ub2c8\ub2e4.\\n\uae30\ub2a5 \ubaa9\ub85d\ubd80\ud130 \ucee4\ubc0b \uba54\uc2dc\uc9c0, \ud568\uc218 \ub124\uc774\ubc0d, \uae30\ub2a5 \uc694\uad6c \uc0ac\ud56d\uc5d0 \uae30\uc7ac\ub418\uc9c0 \uc54a\uc740 \uc608\uc678 \uc0ac\ud56d \ub4f1 \ubaa8\ub450 \uace0\ubbfc\uc774 \ud544\uc694\ud55c \uac83\ub4e4\uc785\ub2c8\ub2e4.\\n\uadf8\ub807\uac8c \ub2e4\uc74c\uacfc \uac19\uc740 \ubaa9\ud45c\ub85c \uc7a1\uc558\uc2b5\ub2c8\ub2e4.\\n\\n> \uc65c \uc774 \ubc29\ubc95\uc744 \uc120\ud0dd\ud588\ub294\uc9c0 \ud655\uc2e4\ud788 \ub9d0 \ud560 \uc218 \uc788\uac8c \ub9cc\ub4e4\uc790!\\n\\n\uadf8\ub7ec\uba74\uc11c \uafb8\uc900\ud788 \uace0\ubbfc\uc5d0 \ub300\ud55c \uc800\ub9cc\uc758 \uc774\uc815\ud45c\ub97c \ud558\ub098\uc529 \uc138\uc6cc\ub098\uac14\uc2b5\ub2c8\ub2e4.\\n\uc774\ub807\uac8c \uace0\ubbfc\ud558\ub2e4 \ubcf4\ub2c8 **\uace0\ubbfc\ub3c4 \uc5b4\ub290\uc0c8 \uc2b5\uad00**\uc774 \ub418\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uc694\uc998\uc5d0\ub294 \uba38\ub9ac\uac00 \uc2a4\uc2a4\ub85c \uacc4\uc18d \uc0dd\uac01\uc744 \ud558\ub824\uace0 \ud569\ub2c8\ub2e4.\\n\uc53b\uc744 \ub54c\ub3c4, \ubc25\uc744 \uba39\uc744 \ub54c\ub3c4, \uc7a0\uc744 \uc790\ub824 \uce68\ub300\uc5d0 \ub204\uc6cc \uc788\uc744 \ub54c\uae4c\uc9c0 \uace0\ubbfc\uc744 \uacc4\uc18d\ud558\uace0 \uc788\ub294 \uc81c \ubaa8\uc2b5\uc5d0 \uc2a4\uc2a4\ub85c \ub180\ub790\uc2b5\ub2c8\ub2e4.\\n\\n## \uc2dc\uac04 \ubcf5\uc7a1\ub3c4\ub97c \ub0ae\ucd94\ub824\uba74 \uadf8\ub9cc\ud07c \uc2dc\uac04\uc744 \ud22c\uc790\ud558\uc790.\\n\\n[1\uc8fc\ucc28 6\ubc88 \ubb38\uc81c](https://github.com/woowacourse-precourse/javascript-onboarding/blob/main/docs/PROBLEM6.md)\uac00 \uc815\ub9d0 \uc800\ub97c \ub9ce\uc774 \uad34\ub86d\ud614\uc2b5\ub2c8\ub2e4.\\n\ubb38\uc81c\ub97c \ucc98\uc74c \uad6c\ud604\ud588\uc744 \ub54c \ubb34\ub824 **n^4\uc758 \uc2dc\uac04 \ubcf5\uc7a1\ub3c4**\uac00 \ub098\uc654\uc2b5\ub2c8\ub2e4.(\uc9c0\uae08 \uc640\uc11c \ud45c\ud604\ud574\ubcf4\ub824\uace0 \ud558\ub2c8 \ub3c4\ub300\uccb4 \uc5b4\ub5bb\uac8c n^4\uc758 \ubcf5\uc7a1\ub3c4\uac00 \ub098\uc654\ub098 \uc2f6\ub124\uc694..)\\n\\n\uc774\ub7f0 \ub290\ub08c\uc758 for\ubb38\uacfc if\ubb38\uc758 \uc9c0\uc625\uc774\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n```javascript\\nfor (let i = 0; i < list.length; i++) {\\n  if (list[i] > 0) {\\n      for (let j = 0; j <\u3160 list.length; j++) {\\n        if (list[j].includes(1) > 0) {\\n          result.map(...)\\n        }\\n      }\\n    }\\n  }\\n```\\n\\n> \uc5b4\ub77c \uc774\uac8c \ub9de\ub098..?\\n\\n\ubd84\uba85\ud788 \ub354 \uc88b\uac8c \ub9cc\ub4e4 \uc218 \uc788\uc9c0 \uc54a\uc744\uae4c\uc694? \ubd84\uba85 \uc81c js \uc9c0\uc2dd\uc774 \ubd80\uc871\ud574\uc11c \ub098\uc628 \ubcf5\uc7a1\ub3c4\ub77c\uace0 \uc0dd\uac01\ud588\uc2b5\ub2c8\ub2e4.\\n\uadf8\ub798\uc11c \uc774 \uae30\ud68c\uc5d0 javascript \uc911\uc5d0\uc11c\ub3c4 \uac1d\uccb4 \ucabd\uc744 \uc880 \ub354 \ubc14\uc0ad\ud558\uac8c \uacf5\ubd80\ud574\uc57c\uaca0\ub2e4\ub294 \ub9c8\uc74c\uc744 \uba39\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uc77c\ub2e8 \ubc30\uc5f4\uacfc \uad00\ub828\ub41c \ubaa8\ub4e0 \uba54\uc18c\ub4dc\ub97c \ucc3e\uc544\ubcf4\ub294 \uac83\uc73c\ub85c \uc2dc\uc791\ud588\uc2b5\ub2c8\ub2e4.\\n\ub2e4\uc591\ud55c javascript \uac1d\uccb4\ub4e4\ub3c4 \ucc3e\uc544\ubcf4\uc558\uc2b5\ub2c8\ub2e4. \uac1d\uccb4\uac00 \uac00\uc9c8 \uc218 \uc788\ub294 \uba54\uc18c\ub4dc\uc640 \ud2b9\uc9d5\ub4e4\ub3c4 \uc0b4\ud3b4\ubcf4\uc558\uc2b5\ub2c8\ub2e4.\\n\uc0dd\uac01\ubcf4\ub2e4 \uac1d\uccb4 \ud558\ub098\uc5d0 \ub300\ud55c \ubaa8\ub4e0 \uba54\uc18c\ub4dc\ub97c \ucc28\uadfc\ucc28\uadfc \uc77d\uc5b4\ubcf4\ub294 \uac83\ub3c4 \uad49\uc7a5\ud788 \uc7ac\ubbf8\uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\ub355\ubd84\uc5d0 \uac70\uc758 3\uc77c \uc815\ub3c4\ub97c \uc774 \uacf5\ubd80 \uc2dc\uac04\uc744 \uc704\ud574 \ud22c\uc790\ud560 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uadf8\ub9ac\uace0 \ubb38\uc81c\ub97c \ub2e4\uc2dc \ubcf4\ub2c8 **\ubc29\ubc95\uc774 \uc21c\uac04\uc801\uc73c\ub85c \ub531 \ubc88\ub729**\uc600\uc2b5\ub2c8\ub2e4..!!\\n\\n> \uc774\uac74 `dictionary`\ub098 `Map`\uc73c\ub85c \uc811\uadfc\ud558\uba74 \uc88b\uc744 \uac83 \uac19\uc740\ub370..?\\n\\n\uadf8\ub7ac\ub354\ub2c8 \uc138\uc0c1\uc5d0\ub098... \uc2dc\uac04 \ubcf5\uc7a1\ub3c4\ub97c \ubb34\ub824 n^2\uae4c\uc9c0 \uc904\uc77c \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. \uc131\ucde8\uac10\uc774 \uc815\ub9d0 \uc5c4\uccad\ub0ac\uc2b5\ub2c8\ub2e4.\\n\uc2a4\uc2a4\ub85c \ud574\ub0c8\ub2e4\ub294 \ubfcc\ub4ef\ud568 \ub54c\ubb38\uc5d0 \uc8fc\ub9d0 \ub0b4\ub0b4 \ud589\ubcf5\ud588\ub358 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n**\ub098\ub3c4 \ud560 \uc218 \uc788\ub2e4\ub294 \uc790\uc2e0\uac10**\uc774 \ubd99\uae30 \uc2dc\uc791\ud588\uc2b5\ub2c8\ub2e4.\\n\\n## git\uc740 \uc815\ub9d0 \uac15\ub825\ud558\ub2e4.\\n\\n`push`, `commit`, `pull` \uac19\uc740 \uae30\ubcf8\uc801\uc778 git\uc744 \uc0ac\uc6a9\ud560 \uc904 \uc54c\uc558\uc2b5\ub2c8\ub2e4. \uadf8\ub798\uc11c \ucc98\uc74c\uc5d0\ub294 \ud06c\uac8c \ubb38\uc81c\uac00 \ub418\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4.\\n\uadf8\ub7f0\ub370 \ucee4\ubc0b \ud6c4\uc5d0 \ucee4\ubc0b \uba54\uc2dc\uc9c0\ub97c \ubcc0\uacbd\ud558\uace0 \uc2f6\uc740 \uac8c \uc0dd\uacbc\uc2b5\ub2c8\ub2e4. \uc774\uac78 \ubc14\uafb8\ub824\ud55c \uac83\uc774 \ubb38\uc81c\uc758 \uc2dc\uc791\uc774\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\uadf8 \ub54c \ubb38\uc81c\ub97c \ud478\ub290\ub77c \uc7a0\uc744 \uc5bc\ub9c8 \ubabb\uc790\uc11c \uadf8\ub7ac\ub294\uc9c0 \uc815\uc2e0\uc774 \uc5c6\ub358 \ub098\uba38\uc9c0 \uc5c4\uccad\ub09c \uc2e4\uc218\ub97c \uc800\uc9c8\ub7ec \ubc84\ub838\uc2b5\ub2c8\ub2e4...\\n\\n<img\\n  src=\\"/img/blog/woowa-precourse-week1-week2/git-hard-reset.png\\"\\n  alt=\\"\uc774\ubbf8\uc9c0\\"\\n  style={{ marginBottom: \\"20px\\" }}\\n/>\\n\\n\uc544\ub9c8 \uccb4\ud06c\uc544\uc6c3\uc744 \ud558\ub824\uace0 \ud588\ub358 \uac83 \uac19\uc740\ub370, **\ud558\ub4dc \ub9ac\uc14b** \ubc84\ud2bc\uc744 \ub20c\ub800\uc2b5\ub2c8\ub2e4..\ud83e\udd2f\\n\uc9c0\uae08\uae4c\uc9c0 \ucf54\ub529\ud588\ub358 \ubaa8\ub4e0\uac8c \uc0ac\ub77c\uc84c\uc2b5\ub2c8\ub2e4. \uac11\uc790\uae30 \uc7a0\uc774 \ud655 \uae7b\uc2b5\ub2c8\ub2e4..\\ngit\uc744 \ubbff\ub294 \uc218 \ubc16\uc5d0 \uc5c6\uc5c8\uc2b5\ub2c8\ub2e4. git\uc774\ub77c\uba74 \uc774\uac78 \ud574\uacb0 \ud560 \uc218 \uc788\uc744\uac70\ub77c\uace0... \uadf8\ub798\uc57c\ub9cc \ud55c\ub2e4\uace0 \uad73\uac8c \ubbff\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\ucc3e\uc544\ubcf4\ub2c8 \ub2e4\ud589\ud788 \ubc29\ubc95\uc740 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. \ub2e4\ub9cc, \uc81c \uae30\uc900\uc73c\ub85c\ub294 \uc544\uc9c1 \uc815\ub9d0 \uc5b4\ub835\uace0 \uc5b4\uc0c9\ud558\uac8c \ub290\uaef4\uc84c\uc2b5\ub2c8\ub2e4.\\n\ub355\ubd84\uc5d0 \uc2dc\uac04\uc744 \uc815\ub9d0 \ub9ce\uc774 \uc4f0\uae30\ub294 \ud588\uc9c0\ub9cc, \uadf8\ub798\ub3c4 \uc774\ub7f0 \ud574\ud504\ub2dd\uc774 \uc77c\uc5b4\ub098\uba74\uc11c git\uc744 \uc815\ub9d0 \ub9ce\uc774 \ubc30\uc6e0\uc2b5\ub2c8\ub2e4.\\n\uc815\ub9d0\uc774\uc9c0 git\uc758 \uac15\ub825\ud568\uc744 \uc81c\ub300\ub85c \uacbd\ud5d8\ud574 \ubcf8 \uc0ac\uac74\uc774\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n:::info\\n\uc2e4\uc81c\ub85c 2\uc8fc\ucc28 \uacfc\uc81c\uc5d0\uc11c \uc774 \ub54c \uacf5\ubd80\ud588\ub358 git reflog, stash \uac19\uc740 \uba85\ub839\uc5b4\ub97c \uc694\uae34\ud558\uac8c \uc0ac\uc6a9\ud588\uc2b5\ub2c8\ub2e4.\ud83d\ude0b\\n:::\\n\\n## \ub09c\uc7c1\uc774\uac00 \uc3d8\uc544\uc62c\ub9b0 \uc791\uc740 \ub2e8\uc704 \ud14c\uc2a4\ud2b8\\n\\n\ud14c\uc2a4\ud2b8 \ucf54\ub4dc\ub97c \ucc98\uc74c \uc811\ud574 \ubcf4\uc558\uc744 \ub54c \ub108\ubb34 \uc2e0\uae30\ud574\uc11c \uacc4\uc18d \ub208\uc5ec\uaca8 \ubcf4\uace0 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\ub54c \ub9c8\uce68 2\uc8fc\ucc28 \ubbf8\uc158\uc5d0\uc11c\ub294 \ud14c\uc2a4\ud2b8 \ucf54\ub4dc\uc5d0 \uc775\uc219\ud574 \uc9c0\ub294 \uac83\uc774 \ud559\uc2b5 \ubaa9\ud45c\uc600\uc2b5\ub2c8\ub2e4.\\n\uadf8\ub798\uc11c \uae30\uc05c \ub9c8\uc74c\uc73c\ub85c \ud14c\uc2a4\ud2b8\uc5d0 \ub300\ud574 \uacf5\ubd80\ud558\ub294 \uc2dc\uac04\uc744 \uac00\uc84c\uc2b5\ub2c8\ub2e4.\\n\\n\ud14c\uc2a4\ud2b8\ub294 \uc815\ub9d0 \uacf5\ubd80\ud558\uba74 \uacf5\ubd80\ud560\uc218\ub85d **\uc5ec\ub7ec\uac00\uc9c0 \ub098\ube44 \ud6a8\uacfc**\ub97c \ubd88\ub7ec\uc624\ub294 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n\uc77c\ub2e8 \ud14c\uc2a4\ud2b8\ub294 \ud568\uc218\ub97c \uc790\uafb8 **\uc791\uac8c \ucabc\uac1c\ub3c4\ub85d \uc720\ub3c4**\ud569\ub2c8\ub2e4. \ubb3c\ub860 \ucf54\ub4dc\ub97c \uc9dc\uae30 \uc804\uc5d0\ub3c4 \ud568\uc218\ub97c \ucd5c\ub300\ud55c \ubd84\ub9ac\ud558\ub824\uace0 \ub9c8\uc74c\uc744 \uba39\uae30\ub294 \ud588\uc5c8\uc2b5\ub2c8\ub2e4.\\n\ud558\uc9c0\ub9cc \ud14c\uc2a4\ud2b8\ub97c \uc0c1\uc138\ud558\uac8c \ud558\uace0 \uc2f6\ub2e4\ubcf4\ub2c8 \uc790\uc5f0\uc2a4\ub7fd\uac8c \ud568\uc218\ub97c \uc791\uac8c \uc790\ub97c \uc218 \ubc16\uc5d0 \uc5c6\ub294 \ud658\uacbd\uc774 \ub9cc\ub4e4\uc5b4\uc84c\uc2b5\ub2c8\ub2e4.\\n\\n<img\\n  src=\\"/img/blog/woowa-precourse-week1-week2/function1.png\\"\\n  alt=\\"\uc774\ubbf8\uc9c0\\"\\n  style={{ marginBottom: \\"20px\\" }}\\n/>\\n<img\\n  src=\\"/img/blog/woowa-precourse-week1-week2/function2.png\\"\\n  alt=\\"\uc774\ubbf8\uc9c0\\"\\n  style={{ marginBottom: \\"20px\\" }}\\n/>\\n\\n\uadf8\ub7ec\ub2e4\ubcf4\ub2c8 \ud55c \ud30c\uc77c\uc5d0 \ud568\uc218\uac00 20\uac1c\uac00 \ub118\uc5b4\uac00\ubc84\ub838\uace0, \uc790\uc5f0\uc2a4\ub7fd\uac8c \uc704\uc640 \uac19\uc774 **\ud30c\uc77c\uc744 \ub098\ub220**\uc8fc\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.\\n2\uc8fc\ucc28 \ubbf8\uc158\uc5d0\ub294 \uae4a\uc774 2\uac00 \ucd08\uacfc \ub418\ub294 \ub4e4\uc5ec\uc4f0\uae30\ub3c4 \uace0\ub824\ud574\uc57c \ub41c\ub2e4\uace0 \ud574\uc11c \uac81\uc744 \uba39\uc5c8\ub294\ub370, \uc798\uac8c \ucabc\uac1c\uc9c4 \ud568\uc218 \ub355\ubd84\uc5d0 \uc774 \uc694\uad6c \uc0ac\ud56d\uc740 \uc798 \ud574\uacb0\ud560 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\ud568\uc218\uac00 \uc9e7\ub2e4\ubcf4\ub2c8 \ud14c\uc2a4\ud2b8\ud558\uae30\uc5d0\ub3c4 \uac04\ud3b8\ud588\uc2b5\ub2c8\ub2e4.\\n\\n\ud14c\uc2a4\ud2b8\ub97c \uc2e0\uacbd\uc368\uc11c \ubbf8\uc158\uc744 \uc9c4\ud589\ud558\ub2e4 \ubcf4\ub2c8 **\ud568\uc218 \ubd84\ub9ac\uc640 \ub4e4\uc5ec\uc4f0\uae30 \uac19\uc740 \uc694\uad6c\uc0ac\ud56d\uc774 \uac19\uc774 \ud574\uacb0** \ub418\uc5c8\uc2b5\ub2c8\ub2e4.\\n\ub098\uc911\uc5d0 \uc774\ub807\uac8c \uc791\uc740 \ub2e8\uc704\ub85c \ub098\ub204\uc5b4 \ud14c\uc2a4\ud2b8\ub97c \uc791\uc131\ud558\ub294 \ubc29\uc2dd\uc744 \ub2e8\uc704 \ud14c\uc2a4\ud2b8\ub77c\uace0 \ubd80\ub978\ub2e4\ub294 \uac83\uc744 \uc54c\uc558\uc2b5\ub2c8\ub2e4.\\n\uc774\ubc88 3\uc8fc\ucc28 \uacfc\uc81c\uc5d0\uc11c \ub2e8\uc704 \ud14c\uc2a4\ud2b8 \uac1c\ub150\uc774 \ub098\uc628 \uac83\uc744 \uc7a0\uae50 \ubd24\ub294\ub370, \ubc8c\uc368\ubd80\ud130 \uc124\ub808\ub124\uc694:)\ud83e\udd2d\\n\\n\uc774\ubc88 \ud14c\uc2a4\ud2b8\ub97c \ud1b5\ud574 \uc0c1\ub2f9\ud788 \ub9ce\uc740 \uac83\uc744 \uc54c\uace0 \ubc30\uc6e0\uc2b5\ub2c8\ub2e4.\\n\\n1. \ud14c\uc2a4\ud2b8 \ucf54\ub4dc\ub294 \uc81c \ucf54\ub4dc\uc5d0 \ud655\uc2e0\uc744 \uc90d\ub2c8\ub2e4.\\n2. \uc790\uc5f0\uc2a4\ub7fd\uac8c \ud568\uc218\ub97c \ubd84\ub9ac\ud558\uac8c \ub429\ub2c8\ub2e4.\\n3. \ud568\uc218\uac00 \ub9ce\uc544\uc9c0\uba74\uc11c \ubaa8\ub4c8\ud654\ub97c \uc2dc\ud0a4\uace0 \ud30c\uc77c \ubd84\ub9ac\ub97c \uc720\ub3c4\ud569\ub2c8\ub2e4.\\n4. \uc791\uc740 \ub2e8\uc704\ub85c \uae30\ub2a5\uc744 \ubc14\ub77c\ubcf4\ub294 \ub370 \uc815\ub9d0 \ub9ce\uc740 \ub3c4\uc6c0\uc774 \ub429\ub2c8\ub2e4.\\n5. \uc774\ud6c4\uc5d0 \ucf54\ub4dc\ub97c \uae54\ub054\ud558\uac8c \uc9e4 \ub54c \uae30\uc900\uc774 \ub418\uc5b4\uc8fc\ub294 \ub290\ub08c\uc785\ub2c8\ub2e4.\\n\\n   - \uc774 \uae30\uc900\uc740 \ud14c\uc2a4\ud2b8\ud558\uae30 \uc88b\uc740 \ucf54\ub4dc\ub77c\uace0 \ud560 \uc218 \uc788\uc9c0 \uc54a\uc744\uae4c\uc694?\\n\\n6. \ub2e4\ub978 \uc0ac\ub78c\uc774 \uc81c \ucf54\ub4dc\ub97c \ubcf4\uace0\uc11c \uae30\ub2a5 \ub2e8\uc704\ub85c \uc774\ud574\ud558\ub294 \ub370\uc5d0\ub3c4 \uad49\uc7a5\ud788 \ub3c4\uc6c0\uc774 \ub9ce\uc774 \ub420 \uac83\uc774\ub77c\ub294 \uc0dd\uac01\uc774 \ub4e4\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n## \uc18c\ud1b5\uc758 \uc990\uac70\uc6c0\\n\\n\uc18c\ud1b5\uc740 \ub108\ubb34 \uc990\uac70\uc6b4 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\ud83d\ude0a \uc774\ubc88 \ud504\ub9ac\ucf54\uc2a4\ub97c \ud558\uba74\uc11c \ucee4\ubba4\ub2c8\ud2f0\ub098, github \ub514\uc2a4\ucee4\uc158\uc5d0 \uc0dd\uac01\ub0a0 \ub54c\ub9c8\ub2e4 \ub4e4\ub9ac\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\n\uc774 \ub54c\ub9c8\ub2e4 \uc6d0\ud558\ub294 \ud1a0\ub860 \uc8fc\uc81c\ub098 \uc774\uc57c\uae30\ub97c \ud558\uace0 \uc2f6\uc740 \uac8c \uc788\uc73c\uba74 \uadf8\uc5d0 \ub300\ud574 \uc18c\ud1b5 \ud558\ub294 \uc2dc\uac04\uc744 \uac00\uc9c0\ub294\uac8c \uc774\ubc88 \ud504\ub9ac\ucf54\uc2a4\ub97c \ud558\uba74\uc11c \uc5bb\ub294 \ud589\ubcf5 \uc911 \ud558\ub098\uc600\uc2b5\ub2c8\ub2e4.\\n**\uc18c\ud1b5\ud558\uba74\uc11c \uc11c\ub85c \uc131\uc7a5**\ud558\uace0 \uc788\ub2e4\uace0 \ub290\ub084 \ub54c\uc758 \uae30\ubd84\uc740 \ub9d0\ub85c \ud45c\ud604\ud558\uae30 \ud798\ub4e0 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n\\n<img\\n  src=\\"/img/blog/woowa-precourse-week1-week2/reaction1.png\\"\\n  alt=\\"\uc774\ubbf8\uc9c0\\"\\n  style={{ marginBottom: \\"20px\\" }}\\n/>\\n\\n\ucee4\ubba4\ub2c8\ud2f0\uc5d0\uc11c \uc7a1\ub2f4\uc774\ub098 \uc815\ubcf4\ub97c \uacf5\uc720\ud558\ub294 \uacfc\uc815\uc5d0\uc11c \uc18c\uc18c\ud558\uac8c \ub9ac\uc561\uc158\uc774 \uc313\uc774\ub294 \uac83\ub3c4 \uc7ac\ubbf8\uc788\uace0 \ubcf4\ub78c\ucc3c\uc2b5\ub2c8\ub2e4.\\n\\n\uc9c1\uc811 \ubaa8\uc544\ub193\uace0 \ubcf4\ub2c8 \ub354\ubfcc\ub4ef\ud55c \uac83 \uac19\uc2b5\ub2c8\ub2e4.\ud83d\ude0a\\n\\n<img\\n  src=\\"/img/blog/woowa-precourse-week1-week2/review1.png\\"\\n  alt=\\"\uc774\ubbf8\uc9c0\\"\\n  style={{ marginBottom: \\"20px\\", marginTop: \\"20px\\" }}\\n/>\\n\\n\ucf54\ub4dc \ud53c\uc5b4 \ub9ac\ubdf0\ub3c4 \uc9c4\ud589\ud588\ub294\ub370, \uc5f4\uc2ec\ud788 \ub2e4\ub978 \uc778\uc6d0\ub4e4\uc758 \ucf54\ub4dc\uc5d0 \ub9ac\ubdf0\ub97c \ub2ec\uc558\ub354\ub2c8 \uaf64 \ub9ce\uc740 \uc778\uc6d0\uc774 [**\uc81c \ucf54\ub4dc\ub97c \ub9ac\ubdf0**](https://github.com/woowacourse-precourse/javascript-onboarding/pull/300)\ud574\uc8fc\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uac01\uc790\uc758 \uc0dd\uac01\uacfc \uc758\uacac\uc5d0\uc11c \ub9ce\uc740 \uc815\ubcf4\ub97c \uc5bb\uc744 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uc911\uac04\uc911\uac04 \ud2b9\uc815 \ucf54\ub4dc \uad6c\uc870\ub97c \uce6d\ucc2c \ud574 \uc8fc\uc2dc\uae30\ub3c4 \ud588\ub294\ub370 \uc774 \ub54c \ucf54\ub4dc\ub97c \uc5f4\uc2ec\ud788 \ud30c\uace0\ub4e0 \ubcf4\ub78c\uc774 \ub290\uaef4\uc838\uc11c \ub108\ubb34 \ud589\ubcf5\ud588\uc2b5\ub2c8\ub2e4.\ud83e\udd17\\n\\n\ud55c \ubd84\uc740 \uc81c \ucf54\ub4dc\ub97c \ud1b5\ud574 \ub9ce\uc774 \ubc30\uc6cc\uac04\ub2e4\uba70 \ube14\ub85c\uadf8 \ud3ec\uc2a4\ud305\uc744 \uc791\uc131\ud558\ub294\ub370 \ud65c\uc6a9\ud574\ub3c4 \ub418\ub0d0\uace0 \uc5ec\ucb48\uc5b4 \ubcf4\uc2dc\uae30\ub3c4 \ud588\uc2b5\ub2c8\ub2e4.\\n\uc9c4\uc9dc \uc774\ub807\uac8c \ubcf4\ub78c\ucc28\uace0 \uc990\uac70\uc6b4 \uc77c\uc774 \uc5b4\ub514 \uc788\uc744\uae4c\uc694?\\n\uc774\uac8c \uc6b0\uc544\ud55c\ud615\uc81c\ub4e4\uc5d0\uc11c \ub9d0\ud558\ub294 \uc120\ud55c \uc601\ud5a5\ub825\uc778\uac00 \uc2f6\uc2b5\ub2c8\ub2e4.\\n\\n:::note\\n\uc704\uc5d0\uc11c \ub9d0\ud55c \ube14\ub85c\uadf8 \uae00\uc774 \uad81\uae08\ud558\uc2dc\ub2e4\uba74 [**\uc774 \ud3ec\uc2a4\ud305**](https://velog.io/@hamham/%EC%9A%B0%ED%85%8C%EC%BD%94-1%EC%A3%BC%EC%B0%A8-%EB%AF%B8%EC%85%98-%ED%9B%84%EA%B8%B0)\uc744 \ucc38\uace0\ud574 \uc8fc\uc138\uc694!\\n:::\\n\\n## \ud63c\uc790 \uacf5\ubd80\ud558\ub294 \uac83\ub3c4 \uc88b\uc9c0\ub9cc \uac19\uc774 \uc131\uc7a5\ud558\ub294 \uac83\ub3c4 \uc88b\ub2e4.\\n\\n\uc5ec\ub7ec \uc0ac\ub78c\ub4e4\uacfc \uae4a\uac8c \uc774\uc57c\uae30\ub97c \ub098\ub204\uc5b4\ubcf4\uace0 \uc2f6\uc558\uace0, \ubbf8\uc158\uc5d0 \ub300\ud55c \ucf54\ub4dc \ub9ac\ubdf0\ub3c4 \ub354\uc6b1 \uc0c1\uc138\ud558\uac8c \uc758\uacac\uc744 \uacf5\uc720\ud558\uace0 \uc2f6\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uac19\uc740 \uc0dd\uac01\uc744 \uac00\uc9c4 \uc0ac\ub78c\ub4e4\uc774 \uaf64 \ub9ce\uc558\ub294\uc9c0, \uc18c\uc218 \uc778\uc6d0\ub4e4\ub07c\ub9ac \uc2a4\ud130\ub514\ub97c \uafb8\ub9ac\ub294 \ucc44\ub110\uc774 \uc0dd\uacbc\uc2b5\ub2c8\ub2e4.\\n\uadf8\ub798\uc11c \uac00\uc7a5 \ucc98\uc74c\uc73c\ub85c \uc0dd\uae34 \ud504\ub860\ud2b8\uc5d4\ub4dc \uc2a4\ud130\ub514\uc778 **\'(\uac00\ub9f9\uc810 1\ud638)\ud504\ub860\ud2b8\uc5d4\ub4dc \ud53c\uc5b4\ub9ac\ubdf0 \uc2a4\ud130\ub514\'**\uc5d0 \uc7ac\ube60\ub974\uac8c \ucc38\uc5ec \uc758\uc0ac\ub97c \ubc1d\ud614\uc2b5\ub2c8\ub2e4.\\n\\n\ucc98\uc74c\uc5d0\ub294 \uc194\uc9c1\ud788 \uc544\uc608 \ubaa8\ub974\ub294 \uc0ac\ub78c\ub4e4\uc774\ub2e4 \ubcf4\ub2c8 \uae34\uc7a5\uc774 \ub418\uae30\ub3c4 \ud588\uc2b5\ub2c8\ub2e4.\\n\ud558\uc9c0\ub9cc \uadf8\uac83\uacfc\ub294 \ubcc4\uac1c\ub85c \ub354 \uc88b\uc740 \ub9ac\ubdf0\ub97c \ud574\uc8fc\uace0 \uc2f6\uc740 \ub9c8\uc74c\uc774 \ucef8\uc2b5\ub2c8\ub2e4.\\n\uc774\ubc88\uc5d0\ub294 **js \ucee8\ubca4\uc158\uc744 \uc704\uc8fc**\ub85c \ub9ac\ubdf0\ub97c \uc9c4\ud589\ud574 \ubd10\ub3c4 \uc88b\uc744 \uac83 \uac19\ub2e4\uace0 \uc0dd\uac01\ud588\uace0, \uadf8\ub798\uc11c [js \ucee8\ubca4\uc158](https://github.com/airbnb/javascript)\uc744 \ucc98\uc74c\ubd80\ud130 \ub05d\uae4c\uc9c0 2\ubc88 \uc815\ub3c4 \uc815\ub3c5\ud558\uba74\uc11c \ub098\ub984 \ub9ac\ubdf0\ub97c \uc704\ud574 \uc774\ub97c \uac08\uc558\ub358 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n\\n<img\\n  src=\\"/img/blog/woowa-precourse-week1-week2/study1.png\\"\\n  alt=\\"\uc774\ubbf8\uc9c0\\"\\n  style={{ marginBottom: \\"20px\\" }}\\n/>\\n\\n\uc815\ub9d0 \ubcf8\uaca9\uc801\uc73c\ub85c \uc2a4\ud130\ub514\ub97c \uc9c4\ud589\ud588\uc2b5\ub2c8\ub2e4.\\n\\n\uacfc\uc81c\uac00 \ub9c8\uac10\ub418\uace0, \uc218\uc694\uc77c\ub0a0 \ubaa8\uc784 \uc804\uae4c\uc9c0 \uc11c\ub85c\uc758 \ucf54\ub4dc\uc5d0 \ub300\ud574 \ub9ac\ubdf0\ud560 \uc810\uc744 \ucc3e\uace0, \uc800\ub141 \uc2dc\uac04\uc5d0 \uac8c\ub354\ud0c0\uc6b4 \uc548\uc5d0\uc11c \uc11c\ub85c\uc758 \uc758\uacac\uc744 \uacf5\uc720\ud558\ub294 \ubc29\uc2dd\uc774\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uc5b4\uc81c \ucc98\uc74c\uc73c\ub85c \uc2a4\ud130\ub514\ub97c \uc9c4\ud589\ud588\uc5c8\ub294\ub370, \ub2e4\ub4e4 \uc815\ub9d0 \uaf3c\uaf3c\ud788 \uc758\uacac\uc744 \uacf5\uc720\ud574 \uc8fc\uc154\uc11c [\ucf54\ub4dc\uc5d0 \ub300\ud55c \ub2e4\uc591\ud55c \uc758\uacac\uacfc \ud53c\ub4dc\ubc31](https://github.com/woowacourse-precourse/javascript-baseball/pull/179)\uc744 \ubc1b\uc744 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\ub2e4\ub4e4 \ucd08\uba74\uc774\uc5c8\uc9c0\ub9cc, \ucf54\ub4dc \uc55e\uc5d0\uc11c\ub294 \ubaa8\ub450 \uc9c4\uc2ec\uc774 \ub418\uc5b4 \uc758\uacac\uc744 \uc798 \uc804\ub2ec\ud574 \uc8fc\uc154\uc11c \ub108\ubb34 \uc88b\uc558\uc2b5\ub2c8\ub2e4.\\n\\n<img\\n  src=\\"/img/blog/woowa-precourse-week1-week2/gather-town1.png\\"\\n  alt=\\"\uc774\ubbf8\uc9c0\\"\\n  style={{ marginBottom: \\"20px\\" }}\\n/>\\n<img\\n  src=\\"/img/blog/woowa-precourse-week1-week2/gather-town2.png\\"\\n  alt=\\"\uc774\ubbf8\uc9c0\\"\\n  style={{ marginBottom: \\"4px\\" }}\\n/>\\n\uc2a4\ud130\ub514\uc6d0\ub4e4\uacfc \uac19\uc774 \uac8c\ub354\ud0c0\uc6b4\uc5d0\uc11c \uc0ac\uc9c4\ub3c4 \ucc0d\uc5c8\uc5b4\uc694!\ud83d\ude0a\\n\\n<br />\\n<br />\\n\\n\ud074\ub9b0 \ucf54\ub4dc\ub97c \uc5f4\uc2ec\ud788 \uacf5\ubd80\ud574 \ud074\ub9b0 \ucf54\ub4dc \uad00\ub828 \uc758\uacac\uc744 \uc798 \ucc1d\uc5b4\uc8fc\uc2e0 \ubd84\ubd80\ud130, jest\ub97c \uc5f4\uc2ec\ud788 \uacf5\ubd80\ud574 jest \ucf54\ub4dc\ub97c \uc5f4\uc2ec\ud788 \ubd10\uc8fc\uc2dc\ub294 \ubd84\uae4c\uc9c0,\\n\uac01\uc790 \uc790\uc2e0\uc788\ub294 \ubd84\uc57c\uac00 \ubaa8\uc774\uace0 \ubaa8\uc774\ub2e4 \ubcf4\ub2c8 \uc815\ub9d0 \uc88b\uc740 \uc2dc\ub108\uc9c0\ub97c \ub0c8\uc2b5\ub2c8\ub2e4. \ub355\ubd84\uc5d0 [\ub0b4\ub824\uac00\uae30\\n\uaddc\uce59](https://hyojaedev.tistory.com/40), \uba54\uc11c\ub4dc \ub124\uc774\ubc0d, \uc758\ubbf8\uc5c6\ub294 \ubc18\ud658\uac12 \ub4f1 \uc5bb\uc5b4\uac00\ub294 \uac83\uc774 \ub108\ubb34\ub098 \ub9ce\uc558\uc2b5\ub2c8\ub2e4.\\n\\n:::tip\\n\ucf54\uce58\uc640 \uc218\ub2e4 \ud0c0\uc784(\ucf54\uc218\ud0c0)\uc5d0\uc11c \uc2a4\ud130\ub514\ub97c \uafb8\ub9b0 \uc778\uc6d0\ub4e4\uc774 \uc788\ub2e4\uba74 \uc774 \ub0b4\uc6a9\uc744 \uacf5\uc720\ud574 \ubcf4\ub294 \uac83\uc774 \uc5b4\ub5bb\uaca0\ub0d0\ub294 \uc758\uacac\uc744 \uc8fc\uc168\uc2b5\ub2c8\ub2e4.\\n\ucf54\uce58\ub2d8\uacfc \ub3d9\uc77c\ud558\uac8c \uc2a4\ud130\ub514\uc6d0 \ubaa8\ub450 \uc6b0\ub9ac\ub9cc \ub098\ub204\uae30\uc5d0\ub294 \uc815\ub9d0 \uc544\uae4c\uc6b4 \ub9ac\ubdf0 \ub0b4\uc6a9\uc774\ub77c\uace0 \uc0dd\uac01\uc744 \ud588\uc2b5\ub2c8\ub2e4.\\n\uadf8\ub798\uc11c \ub2e4\uc74c \uc8fc\ucc28\ubd80\ud130\ub294 **github \ub514\uc2a4\ucee4\uc158\uc744 \ud1b5\ud574 \ub9ac\ubdf0 \ub0b4\uc6a9\uc744 \uc5ec\ub7ec \uc0ac\ub78c\ub4e4\uc5d0\uac8c \uacf5\uc720**\ud574\ubcf4\uae30\ub85c \ud588\uc2b5\ub2c8\ub2e4!\\n:::\\n\\n## \ub9c8\uce58\uba70\\n\\n\uc774\ubc88 \ud504\ub9ac\ucf54\uc2a4 \uacbd\ud5d8\uc744 \ud1b5\ud574 \uc2a4\uc2a4\ub85c \uc5ec\ub7ec \ubc29\uba74\uc73c\ub85c \uc131\uc7a5\ud558\uace0 \uc788\uc74c\uc744 \ub9ce\uc774 \ub290\ub07c\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\n\uc9c0\uc2dd\ub3c4 \uc9c0\uc2dd\uc774\uaca0\uc9c0\ub9cc, \uc800\uc758 \ub9c8\uc778\ub4dc\uc14b\ub3c4 \uc815\ub9d0 \ub9ce\uc774 \ubcc0\ud558\uace0 \uac1c\ubc1c\uc774 \uc810\uc810 \uc7ac\ubbf8\uc788\uc5b4\uc9c0\ub294 \ud070 \uacc4\uae30\uac00 \ub418\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\n\uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4\uac00 \uc774\ubc88 \ud504\ub9ac\ucf54\uc2a4\ub97c \ud1b5\ud574 \ubb34\uc5c7\uc778\uac00\uc5d0 \ubab0\ub450\ud558\ub294 \uacbd\ud5d8\uc744 \uccb4\ud5d8\uc8fc\uace0 \uc2f6\uc740 \uc758\ub3c4\uac00 \uc788\uc5c8\ub2e4\uba74 \ub300\uc131\uacf5\uc774\ub77c\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4.\\n\uc774\ub7f0 \ub73b \uae4a\uc740 \uacbd\ud5d8\uc744 \uc120\ubb3c\ud574\uc900 \uc6b0\uc544\ud55c\ud14c\ud06c\ucf54\uc2a4\ub97c \ube44\ub86f\ud55c \uc18c\ud1b5\uc5d0 \ucc38\uc5ec \ud574\uc8fc\uc2e0 \ubaa8\ub450\uc5d0\uac8c \uc815\ub9d0 \uace0\ub9d9\ub2e4\ub294 \ub9d0\uc744 \uc804\ud558\uace0 \uc2f6\uc2b5\ub2c8\ub2e4."}]}')}}]);